    componentDidMount(){
      //임시 보호 스와이퍼
      var swiper = new Swiper('.tmpProtection', {
        slidesPerView: 5,
        spaceBetween: 30,
        pagination: {
          el: '.swiper-pagination',
          clickable: true,
        },
      });
