                            <div className="img" style={{backgroundImage:"url(https://i.pinimg.com/564x/ba/f4/4c/baf44ce74e8458729116c5e69ae2c48c.jpg)"}}></div>
                            <div className="area">경기</div>
                        </li>
                        <li className="swiper-slide">
